import React, { useContext } from 'react'
import { PostProviderContext } from '../context/PostProvider'
import { Post } from "./Post"

export const Feed = () => {

    const { allPosts } = useContext(PostProviderContext)

    return (
        <div>
        {allPosts.map(post=> <Post { ...post} key={post._id}/> )}
        </div>
    )
}
